But it is real now in our genration
Why?
Bcz  in today's world our generation is in constant competition

It is a constant struggle to FIT IN
Fit in to the old clothes
Fit in to the regular social circle
Fit in to the tip too girl she used to be
The fear of missing out the gathering where you cant go bcz of the baby
The anxiety of how everything is dofferent now,different from others
The disappointment when all you want is being appreciated and all you hear is YE KIS PR GAYA HAI,PHLY SY KAMZOOR HOGAYA HAI ,YOU NEED TO FEED HIM MORE

