Boost her confidence men don't break it further
She is accepting her body,tolerating pain yet she is smiling
 The deperation after child birth is real and it comes from the surroundings.
In today's world everyone is trying to FIT IN and win the RACE

To new mom,
Don't rush to go back to life as soon as you leave the hospital
Don't expect much from ppl
You need time to face the world again
Give yourself time
The rush causes to anxiety and leads to depression

To the ppl around the new mom,
You need to watch your words ,she is already feeling leftout and any thing negative about her body and baby is the last thing she wants to hear
Plz be the KINDEST you can ever be

In short you need to slow down,the world will be ready for you when YOU are ready for it . don't push yourself, you will be pushed back 

Heal.Recover.Getready...
You are not missing out on anything extraordinary , you have the extraordinary lil besides you dude just chill and relax bcz that lil one is your world

